import React from 'react'

const DogCard = ({ img_url, breed, subbreed }) => {
  return (
    <div className="dog_card">
      <img src={img_url} alt={img_url} className="dog_card__picture" />
      <div className="dog_card__body">{breed}</div>
      <div className="dog_card__body">{subbreed}</div>
    </div>
  )
}

export default DogCard
